import 'package:ieca_mobile/enums/hymns_content_code.dart';
import 'package:ieca_mobile/models/_import.dart';
import 'package:ieca_mobile/seeders/_import.dart';

class NgHymnsKuendaKuaMukuaYesu {
  static List<HymnsContent> list =[
    HymnsContent(id: 3346, position: 1, content: "Nga tu enda vuino na mezi a Njambi, \nA tu vezikisa mu njila; \nNga tu tamunuka A ka kala netu, \nNava vose va Mu tsiliela.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3347, content: "Mu tsiliele, u Mu tamunuke, \nKaha u hasa ku Mu viukilila Yesu.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_35, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3348, position: 2, content: "Na cimo ci hasa ku iza kuli etu, \nA ka vi sekuila ku laako; \nVuoma na zimpata cipue ku zuzuka, \nKa vi kala nga tu zangama.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3349, position: 3, content: "Tu tuala citeli na vusiua hano, \nVunoni A tu fueta vuino; \nKu linienga cahi cipue ku katala, \nTu vezika nga tu zangama.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3350, position: 4, content: "Ka tu hasa vene ku Mu tantekeya, \nNga ka tua lihitile viose; \nMuomu vuana Vueni na ku viukilila, \nVi li viavo va Mu tsiliela.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_35, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3351, position: 5, content: "Kaha tu tumame ku viliato Vieni, \nCipue tu enda mumo Neni; \nViuma A tu leka cipue A tu tuma, \nTu ka linga na ku zangama.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_35, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3352, position: 1, content: "Kuose A tuamena, nji tava ku ya, \nIkeye Muovole na Muene yange; \nCipue na vitozi ndzita nji ka lua, \nNji ku mehia Eni, mbuto ku kuva.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3353, content: "Muangana, tuamena,  \nNji ka ku kava, \nHamo Nove, Yesu,  \nNji hianga ku enda.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_36, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3354, position: 2, content: "Kuose A tuamena, Muovole uange, \nMu u handeka mutima ua cilemo; \nHamo lika Neni, vuoma vuahiko, \nKuose A tuamena nji zolelako.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_36, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3355, position: 3, content: "Kuose A nji tuma, ni A nji tuala, \nHamo Neni nji ka uana ku kala; \nKuose A tuamena, nji ka Mu imbila, \n“Kuku, U li nange, ka nji zuzuka”.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_36, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3356, position: 1, content: "Kala nange, litangula lia toko, \nKu iza vutsiki, Muene kalako, \nOse mikuasi yeka i teua, \nYove Mukuasi kalako nange.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3357, position: 2, content: "Vungendzi vuange vu ka hua lusi, \nViuma via hantsi via ku zolesa, \nVi ka vola, vi ka hita vuasi, \nYove mukua-ku-kala, kalako.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3358, position: 3, content: "Nji ci xaka Yove ntsimbu Yose, \nVika vi hasa ku xeka Satana? \nYove lika U hasa ku kuasa, \nNtsimbu ya ku eseka kala nange.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3359, position: 4, content: "Nji ka simpa nga U kala nange, \nVia-vivi vi ka kala via ngoco; \nKuli, kuli ku-suma kua ku-tsa, \nNji ka hiana nga U kala nange.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_37, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3360, position: 5, content: "Omo nji ka tsa, Yove kalako, \nNji tuamene kuilu kuli Njambi; \nCimenemene ca lilu ci iza, \nMu muono, mu ku-tsa kala nange.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_37, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3361, position: 1, content: "Nja vezika muli Yesu, \nLizi Lieni nja tava; \nNji na Mu tsiliela vene, \nMuomu Ikeye Muovole.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3362, content: "Yesu, Yesu, nja tsiliela, \nA huimisa mutima; \nYesu, Yesu, nji Mu lema, \nNja vezika cikuma.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_38, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3363, position: 2, content: "Nja tsiliela muli Yesu, \nMu maninga nja tane; \nNji na sambue ku milonga;\nNa njecela ku vipi.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3364, position: 3, content: "Nji pangela Muene Yesu, \nViose viange nja seza; \nNji tambula ngolo Yeni, \nMuono, ngozi, ciyulo.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_38, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3365, position: 4, content: "Nji zolela muli Yesu \nKavusamba ua cili; \nA ka kala hamo nange, \nNoho nji heta muilu.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_38, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3366, position: 1, content: "Kaniungi kange Yehova, \nA vi suisa vi nja jena; \nMisenge ya ivua, A nji tuamena \nKu mema a jela.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3367, position: 2, content: "A nji vuahesa mu mbunge, \nMu vusunga A nji endesa; \nNa mu vinjila via ku oloka, \nNa lizina lia livua.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3368, position: 3, content: "Nambe mu cimbongo ca ku-tsa, \nKa nji zuzuka vuvi; \nMulamu Uendi na mpango, \nVi nji zembeleka.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3369, position: 4, content: "Mesa yange A i jala, \nNambe va nji zinda; \nNa mazi ku mutue A nji vuavesa, \nNa ngandza i sumpoka.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_39, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3370, position: 5, content: "Ngozi na vuvua vi nji kava, \nNoko muono u hua; \nKuilu ku ndzivo ya Njambi, \nNji ka tumbamako.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_39, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3371, position: 1, content: "A nji tuamena, nji ivua \nMezi a ku lembezieka; \nViuma viose nji ka linga, \nViose Njambi A tuamena.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3372, content: "A tuamena, A tuamena, \nNa livoko Lieni vene; \nNji ka Mu kava ku hiehi \nMuomu A tuamena cili.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_40, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3373, position: 2, content: "Mpano ntsimbu ya vusiua, \nMpano ntsimbu ya ku viuka; \nHavandonga, ha visali, \nViose Njambi A tuamena.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3374, position: 3, content: "Nji kuata livoko Lieni, \nNa ku linienieta cahi; \nKu viose nji ka zolela, \nMuomu Njambi A tuamena.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_40, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3375, position: 4, content: "Viose vipange vi na hu, \nU na nji hianesa, Yesu: \nKu-tsa vene ka nji tina, \nMuomu Yove U tuamena.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_40, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3376, position: 1, content: "Omo viuma via hasi vi ku eseka, \nNambe vi ku vindamesa manene; \nTandako vivezikiso via Njambi, \nTanda cimo na cimo u komoke.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3377, content: "Tanda vivezikiso viove, \nU mone Njambi na lingile; \nU vi mone, cimo na cimo; \nVi ku komouesa muafua via vingi.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_41, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3378, position: 2, content: "U lisangumuina navio ololo, \nCitele cove ci lema manene? \nTandako vivezikiso via Njambi, \nCo u ka zolela muafua via vingi.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3379, position: 3, content: "Nga u tala kuli vakua-ku-fuka,\nLianukise vizango via Kilistu; \nA ku hana yove limbo na muono, \nFumbelo ka hasa ku vi landako.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_41, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3380, position: 4, content: "Ngoco vene keti u vindameko, \nNambe ku vieseko na ku vusonde; \nMuafua Njambi A ci lela ha mavu, \nA ka ku kuasa u Mu kulahela.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_41, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3381, position: 1, content: "Lizina lia Yesu Muene, \nTuala nove ololo; \nLi hasa ku zembeleka, \nVantu vose ha mavu.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3382, content: "Lizina lia Yesu, \nNtsimbu yose u tuala.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_42, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3383, position: 2, content: "Ntsimbu yose u li tuala, \nKu ku niunga mu njila; \nLi pua ntelo ya ava Vendi, \nKu vusonde li fuila.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3384, position: 3, content: "Lizina lia ku tovala, \nKuli vantu va Yesu; \nLi va hana ku zolela, \nMu mbunge yavo vene.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_42, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3385, position: 4, content: "Mu lizina lia Mue Yesu \nMavuli a tsikama; \nMuene ya vimiene viose, \nMuilu naua ha mavu.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_42, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3386, position: 1, content: "Keti u zaze mukuetu, \nNjambi A ku niunga; \nKuli Ikeye ka kuesi liova, \nNjambi A ku niunga.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3387, content: "Njambi A ku niunga, \nKu matangua, Ku vinjila; \nIkeye A ku niunga, \nNjambi A ku niunga.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_43, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3388, position: 2, content: "Nambe ua juka manene, \nNjambi A ku niunga; \nNa ku tambuile citele, \nNjambi A ku niunga.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3389, position: 3, content: "Viose Njambi A ku muesa, \nNjambi A ku niunga; \nNga ua Mu lombo kaku umina, \nNjambi A ku niunga.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_43, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3390, position: 4, content: "Hamo u uana vieseko, \nNjambi A ku niunga; \nA ku kuata na mavoko, \nNjambi A ku niunga.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_43, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3391, position: 1, content: "Njambi a kale nenu vose, \nA mi niunge na kavumbi; \nA mi hake ku vampanga, \nNjambi A kale nenu vose.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3392, content: "Ku litangua, ku litangua \nLia ku liuana na Yesu; \nKu litangua lia Yesu, \nNjambi A kale nenu vose.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_44, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3393, position: 2, content: "Njambi A kale nenu vose, \nA mi fuike na vimbava; \nA mi hane ku-lia kuenu, \nNjambi a kale nenu vose.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3394, position: 3, content: "Njambi A kale nenu vose, \nOmo vusonde vu heta, \nA mi vumbatele yenu, \nNjambi A kale nenu vose.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_44, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3395, position: 4, content: "Njambi A kale nenu vose,\nA ka mi sueke na ngozi;\nA payese ku-tsa kuenu, \nNjambi A kale nenu vose.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_44, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3396, position: 1, content: "Vusamba vua Yesu \nVu hiana ku viuka; \nKu mitima tu likata, \nNaua ku lilema.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3397, position: 2, content: "Tu na yande hamo \nKu masiua etu; \nKaha tu na viukilila \nKu lilembezieka.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3398, position: 3, content: "Tu vundila Tata \nA tu niunge kuose; \nA takamese mitima \nMu ku Mu tsiliela.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_45, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3399, position: 4, content: "Mu tu lisalesa \nMitima i lava; \nVunoni tu ka limona \nHa mavu, ni muilu.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_45, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3400, position: 1, content: "Ku ka kala maualala,  \nYesu na likumininia; \nA ku vezika kua kama  \nKu huma kuli Endi.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3401, content: "A ku vezika, maualala a muilu, \nTu mona mambake a ngozi; \nMaualala tu lomba.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_46, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3402, position: 2, content: "Ku ka kala maualala,  \nMaualala a muono; \nHa mincinda, mu vimbongo, \nMema a engi muamo.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3403, position: 3, content: "Ku ka kala maualala.  \nKalamba A tu tume. \nTu mone muono ua uha,  \nNgue ku zinkanda Zove.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_46, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3404, position: 4, content: "Ku ka kala maualala,  \nNga lelo vene a eze. \nOmo tu litava vupi  \nKuli kalamba Yesu.", hymnsNumber: NgHymnsNumberSeeder.KUENDA_KUA_MUKUA_YESU_46, typeStanza: HymnsContentCode.VERSE),
  ];
}